import React from "react";
import Navbar from "../common/Navbar";
import Footer from "../common/Footer";

function BlogPostEdit() {
  return (
    <div className="blog-post-edit">
      <Navbar />
      <h1>Edit blog post</h1>
      <Footer />
    </div>
  );
}

export default BlogPostEdit;
